import React, { useState } from 'react';
import { Button, Modal, Input } from 'antd';
import 'antd/dist/reset.css';
import "./Recuperar2.css";

export const Recuperar2 = ({ isVisible, onClose }) => {

  const [modalOpen, setModalOpen] = useState(false);
  
  if (!isVisible) return null

  const handleClose = (e) => {
    if (e.target.id === 'wrapper') onClose()
  }

  return (
    <>
      <Button type="primary" onClick={() => setModalOpen(true)}>
        Vertically centered modal dialog
      </Button>
      <Modal
        title="Recuperar Contraseña"
        centered
        open={modalOpen}
        onCancel={() => setModalOpen(false)}
        footer={null}
        className='modal_recuperar1'
      >
        <div className="div">
          <p className='text'>Ingrese el correo o código del proyecto</p>
        </div>

        <Input className='input'></Input>
        <Button className='boton_enviar'>Enviar Código</Button>
      </Modal>
    </>
  );
};

export default Recuperar2;
